import http from './httpService';
import config from './config.json';

export const addTask = task => {
    return http.post(`${config.apiBaseURL}/api/v1/task/add`,JSON.stringify(task),{withCredentials: true});
}

export const taskList = () => {
    return http.get(`${config.apiBaseURL}/api/v1/task/list`,null,{withCredentials: true});
}
